import React from 'react'
import userService from '../services/users'


const UserInformation = ( ) => {

    return(
        <div>
            {userService.getAll.map(user =>
                <div key={user.id}>
                    {user.name}
                </div>

            )}
        </div>
    )
}


export default UserInformation
